import ptolemy.data

class Main:
	@staticmethod
	def zdt4(x):
		import math
		def h(f, g):
			return 1.0 - math.sqrt(f / g)

		def g(x):
				result = 91.0

				for i in range(1, 10):
					result += pow(x[i], 2) - 10 * math.cos(4 * math.pi * x[i]);

				return result
		return g(x) * h(x[0], g(x))

	def build_array(self, point):
		arrToks = point.arrayValue()
		return [i.doubleValue() for i in arrToks]

	def fire(self) :
		token = self.input.get(0)
		values = self.build_array(token)
		results = [values[0], self.zdt4(values)]

		if self.actor.isDebugging():
			self.actor.debug("Evaluating %s" % values)
			self.actor.debug("Results: %s" % results)

		#import time
		#time.sleep(1)
		self.o1.broadcast(ptolemy.data.DoubleToken(results[0]))
		self.o2.broadcast(ptolemy.data.DoubleToken(results[1]))
